;; **
;;; ## Compiling the model
;; **

;; @@
(defn combine-observes-fn [observes]
  (mapv :value observes))

(def replier (zmq/start-replier polynomial-regression [(repeat 10 0) (repeat 10 0)] combine-observes-fn))
